import {Injectable} from '@angular/core';

import { AppSettings } from '../../../app.settings';
import { Util } from './../util/util';
import * as jsPDF from 'jspdf';

@Injectable()
export class PdfService {

    _util = Util;

    getDeclaracaoAdimplenciaAssociado(nome: string, anuidade: number): void {

        const doc = new jsPDF();
        doc.setFontSize(14);
        doc.setFont('helvetica');

        // Logo: Inicio
        // tslint:disable-next-line:max-line-length
        const imgData = 'data:image/png;base64,';
        doc.addImage(imgData, 'PNG', 80, 50, 50, 50);
        // Logo: fim

        // tslint:disable-next-line:max-line-length
        doc.text(`Declaramos, para os devidos fins, que ${nome} encontra-se com a anuidade relativa ao ano de ${anuidade} em dia, referente à associação à Federação Brasileira de Terapias Cognitivas, válida até o dia ${AppSettings.DIA_FIM_VALIDADE_CERTIFICADO} de ${AppSettings.MES_FIM_VALIDADE_CERTIFICADO} de ${AppSettings.GetAnoFimValidadCertificado(anuidade)}, podendo usufruir de todos os benefícios estatutários neste período.`, 15, 110, {maxWidth: 180, align: 'justify'});

        doc.setFontSize(12);
        doc.setFont('helvetica');

        const now = new Date();
        // tslint:disable-next-line:max-line-length
        doc.text(`Ribeirão Preto, dia ${('0' + now.getDate()).slice(-2)} de ${this._util.NomeMes(now.getMonth() + 1)} de ${now.getFullYear()}.`, 15, 160);
        doc.text(`Secretaria Executiva`, 15, 175);
        doc.text(`Federação Brasileira de Terapias Cognitivas`, 15, 180);

        doc.setDrawColor('#B19292');
        doc.setLineWidth(2.5);
        doc.line(15, 190, 195, 190);
        doc.line(15, 194, 195, 194);

        doc.setFontSize(11);
        doc.text('Federação Brasileira de Terapias Cognitivas', 15, 200);
        doc.text('Departamento de Psicologia - FFCLRP - USP', 15, 205);
        doc.text('LaPICC - Sala 29, bloco 5', 15, 210);
        doc.text('Av. Bandeirantes, 3.900 - Bairro Monte Alegre', 15, 215);

        doc.save(`FBTC - Certificado de Adimplência - Anuidade ${anuidade} - ${nome}`);
    }
}
